import React from "react";

import NavigationBar from "../navigation/NavigationBar";

import "./Home.css";

const Home = () => {
	return (
		<div className="home">
			<NavigationBar />
			<div>
				Discord Link
			</div>
		</div>
	);
};

export default Home;
